import logo from './../logo/call.png';
import './skills.css';

function Skills() {
    return (
        <div>
            <div class="flip-card">
                <div class="flip-card-inner">
                    <div class="flip-card-front">
                        <img src={logo} alt="Avatar" width="300px" height="300px" />
                        <div class="flip-card-back">
                            <h1>John Doe</h1>
                            <p>Architect & Engineer</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Skills;
